INSERT INTO `keterangan` VALUES (1,12,1,'2017-01-06','dibawa ke service center'),(2,12,14,'2017-01-07','ambil dari service center'),(3,12,14,'2017-01-08','masih rusak kirim ke ho sunter'),(4,12,1,'2017-01-10','kirim lagi ke sevice center '),(5,12,14,'2017-01-13','terima dari ho sunter'),(6,12,1,'2017-01-16','hasil cetak bergaris'),(7,14,1,'2016-12-22','Kirim ke wahana, tidak bisa diperbaiki lagi karena mending ganti baru daripada ganti mainboard'),(8,7,1,'2017-01-15','sudah ok'),(9,16,1,'2017-01-04','Test kipas di Zotac lain, normal. Solder ulang jalur / socket kipas, test ulang > normal. Pindahkan SSD dari zotac lain yg dikirim. Test running - normal semuanya. ----------  Selesai  ------------'),(10,17,1,'2017-01-04','test kipas di zotac yg sdh bagus, normal. solder ulang jalur dan socket fan, test kembali - masih belum berfungsi kipasnya.  \r\n\r\nSaran : bawa ke rapair mainboard untuk perbaikan komponen.\r\n\r\n---- Pending ----'),(11,18,1,'2017-01-04','test mainboard pakai kipas zotac yang masih error (kipas normal) dan memorynya, tidak berfungsi. Solder ulang jalur dan socket nya, test ulang > masih tidak bisa berputar kipasnya.\r\n\r\nSaran : bawa ke reperasi mainboard.\r\n\r\n--- pending ---'),(12,21,1,'2016-12-30','Solder ulang port USB, bersihkan head Printer dengan alcohol. Test printer sdh kedetect, head masih bergaris > tdk ganti head karena sudah tidak digunakan / pengadaan unit lagi. \r\n\r\n--- Selesai ---'),(13,22,1,'2016-12-30','ganti port usb > test normal\r\nbersihkan head dengan alchohol > normal - hasil print rada tipis tapi masih terbaca barcode di scanner barcode. Sudah tidak ada penggantian head.\r\n\r\n--- Selesai ---'),(14,25,1,'2016-12-30','solder ulang port USB > test normal\r\nbersihkan head gunakan alchohol > normal tetapi rada tipis. Test scan barcode, berhasil di baca.\r\n\r\n--- Selesai ---'),(15,27,1,'2017-01-03','Port USB tidak ada . Ganti port usb > test normal - kedetect.     \r\nbersihkan head dengan alchohol > masih bergaris - ganti head - Nomral\r\n\r\n--- Selesai ---'),(16,28,1,'2017-01-03','solder ulang port USB yang goyang > test ulang - normal.   \r\nBersihkan head, test ulang - masih bergaris.  Ganti Head - test ulang keseluruhan > normal\r\n\r\n---  Selesai  ---'),(17,26,1,'2017-01-06','test scanner - normal nyala - test scanner > normal.  Respon scanner pakai aplikasi agak lambat, koordinasi dengan mas bambang - akan ada perbaikan d aplikaisnya.\r\n\r\n--- Selesai ---'),(18,37,1,'2017-01-11','barang diterima, repair selesai'),(19,31,1,'2017-01-06','coba bersihkan tidak berhasil, masih ada cact cetaknya... keramik head ada cacat - ganti head, test - normal.\r\n\r\n--- selesai ---'),(20,34,23,'2017-01-20','pengajuan pembelian sparepart konektor power adaptor.'),(21,34,23,'2017-01-25','pasang konektor, test power - OK , test print - OK \r\nkirim balik ke T3U jika ada rencana ke CGK.\r\n----- Selelsai -----'),(22,20,23,'2017-01-11','Ganti Kipas casing, pasang HDD baru, ganti tombol power. Test keseluruhan, normal. \r\nDikerjakan oleh ADI.    \r\n---- Selesai ----'),(23,19,23,'2017-01-11','Pasang Kipas casing, pasang HDD baru, ganti tombol power. Test keseluruhan, normal. \r\nDikerjakan oleh ADI.    \r\n---- Selesai ----'),(24,14,23,'2017-01-05','Unit Tidak bisa di perbaiki. \r\n---- Selesai -----'),(25,39,1,'2017-01-27','check power dc output adaptor di boardnya tidak ada... coba tukar board lainnya utk test - normal,  mainboard error.\r\nService ke Epson, masih garansi.'),(26,38,23,'2017-01-27','test reset hardware, test print masih sama. Error di mainbaord, kirim ke service center zebra');
